import React from "react";
import './rightbar.css'

function RightBar(){
    return(
        <div className="rightBar-container">
            <div className="rightBar-wrapper">
                <div className="schedule-container">
                    <img className="schedule-image" src="https://marketplace.canva.com/EAFN8syLrEw/1/0/900w/canva-gray-and-brown-minimalist-schedule-today-instagram-story-oJoSA9xf8NI.jpg"></img>
                    <span className="schedule-text">Schedule for today!</span>
                </div>
            </div>
        </div>
    )
}
export default RightBar;
